.container-header-other {
	background-color: $background-color-pink;
	position: relative;

}

.header-conteiner {
	display: flex;
	justify-content: space-between;
	align-items: center;

	@media screen and (max-width: 1279px) {
		align-items: center;
	}

	@media screen and (min-width: 768px) {
		padding-top: 37px;

	}

	@media screen and (min-width: 1280px) {
		padding-left: 46px;
	}
}

.menu-button {
	z-index: 55;
	margin-left: 30px;
	@media screen and (max-width: 767px) {
		display: none;

	}
}

.navigatio {

	@media screen and (max-width: 1279px) {
		display: none;
	}
}

.nav-list {
	display: flex;
	position: relative;
	z-index: 40;
}

.tablet-menu-button {

	z-index: 100;
	display: block;
	border: none;
	padding: 0;
	margin: 0;
	background-color: transparent;
	padding-bottom: 17px;
	padding-top: 17px;
	padding-left: 17px;

	@media screen and (max-width: 767px) {
		position: relative;
	}

	@media screen and (min-width: 1280px) {
		display: none;
	}


