  display: inline-block;
  margin-bottom: 130px;
  padding-top: 160px;
  padding-bottom: 41px;
  text-align: center;
  max-width: 280px;

  border-radius: 24px;

  @media screen and (min-width: 768px) {
    max-width: 220px;
    margin-bottom: 0;
  }

  @media screen and (min-width: 1280px) {
    max-width: 330px;
    padding-top: 163px;
    padding-bottom: 50px;
  }
