.cream {
  background-color: $background-color-pink;
}

.coffee {
  background-color: $background-color-yellow;
}

.milk {
  background-color: $background-color-green;
}

.product-image {
  position: absolute;
  top: -23%;
  right: 5%;

  @media screen and (min-width: 768px) {
    right: 0;
    left: 0;
    top: -21%;
  }

  @media screen and (min-width: 1280px) {
    top: -41%;
  }
