  font-family: $fonts-title;
  font-weight: 400;
  font-size: 20px;
  line-height: 1.15;

  letter-spacing: 0.04em;
  text-transform: uppercase;
  color: $primary-white;

  @media screen and (min-width: 1280px) {
    font-size: 30px;
    line-height: 1.13;
  }
}

.product-ellipse {
  display: inline-block;
  margin-bottom: 30px;
